import React from "react";
import { Login } from "../index";
import { connect } from "react-redux";

function Root() {
  return (
    <div>
      <Login />
    </div>
  );
}

const mapStateToProps = (state) => ({
  isAuthenticated: state.auth.isAuthenticated,
});

export default connect(mapStateToProps, null)(Root);
